(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0c76d2"],{5122:function(i,a){var o='<h1 id=ekipa>Ekipa</h1> <p><strong>COVID-19 v Sloveniji je odprto podatkovni in odprto kodni projekt, ki ne bi bil mogoč brez številnih vnosov in komentarjev v bazo bolj ali manj anonimnih posameznikov, sodelavcev, znancev, kolegov ter izmenjave idej skupnosti na Slacku. HVALA!</strong></p> <p>Gre za &quot;crowdsourced&quot; projekt, kjer <strong>lahko vsak prispeva</strong> tako, da vnese kakšen nov vir ali informacijo iz svojega okolja - <a href="https://docs.google.com/spreadsheets/d/1N1qLMoWyi3WFGhIpPFzKsFmVE0IwNP3elb_c18t2DwY/edit#gid=0">enostavno jo dodate kot komentar na katerokoli polje v dokumentu</a>. Veseli bomo tudi podatkov iz bolnišnic, štabov Civilne zaščite ipd ali pa zgolj javne podpore v zahtevi za transparentno in ažurno objavljanje podatkov.</p> <p>Imaš predlog za izboljšanje strukture ali oblike dokumenta, bi urejal/a vire o zdravstvenem sistemu ali COVID-19 ali pomagal/a kako drugače? Javi se nam in <a href=mailto:info@sledilnik.org>dobiš pravice za urejanje</a> dokumenta. Če pa lahko projektu nameniš nekaj časa vsak dan, se pridruži <a href=http://slo-covid-19.slack.com>naši Slack skupnosti</a>. Več informacij na <a href=mailto:info@sledilnik.org>info@sledilnik.org</a>.</p> <p>Uredniki baze in ostali sodelavci:</p> <ul> <li><a href=https://twitter.com/aleksj>Aleks Jakulin</a> - viri, modeliranje</li> <li><a href=http://github.com/overlordtm>Andraž Vrhovec</a> - CSV oblika, spletna stran</li> <li><a href=https://podcrto.si/author/anze/ >Anže Voh Boštic</a> - viri, validacija virov, modeliranje</li> <li><a href=https://twitter.com/BojanKosir>Bojan Košir</a> - viri, validacija podatkov</li> <li><a href=https://github.com/VesterDe>Demjan Vester</a> - vizualizacije</li> <li><a href=https://www.linkedin.com/in/gregamilcinski/ >Grega Milčinski</a> - viri, validacija podatkov</li> <li><a href=https://github.com/joahim>Joh Dokler</a> - vizualizacije</li> <li><a href=https://www.linkedin.com/in/juresobocan>Jure Sobočan</a> - logo, grafično oblikovanje</li> <li><a href=https://www.facebook.com/luka.medic.79>Luka Medic</a> - viri, validacija podatkov, modeliranje</li> <li><a href=https://twitter.com/lukarenko>Luka Renko</a> - koordinacija, podatkovna struktura in validacija</li> <li><a href=https://twitter.com/maksmrzek>Maks Mržek</a> - validacija, modeliranje, vizualizacije, koordinacija</li> <li><a href=https://twitter.com/miha_kadunc>Miha Kadunc</a> - model bolnišničnih podatkov, modeliranje</li> <li><a href=https://twitter.com/multikultivator>Marko B</a> - viri, spletna stran, dataviz</li> <li><a href=https://www.linkedin.com/in/matejjurko/ >Matej Jurko</a> - viri, validacija podatkov</li> <li><a href=https://www.linkedin.com/in/matejmeglic/ >Matej Meglič</a> - viri, validacija podatkov</li> <li><a href=https://twitter.com/MatjazL>Matjaž Lipuš</a> - viri, validacija podatkov</li> <li><a href=https://twitter.com/MihaMarkic>Miha Markič</a> - REST API</li> <li><a href=https://www.nace.si/ >Nace Štruc</a> - vizualizacije</li> <li><a href=https://twitter.com/pkese/ >Peter Keše</a> - vizualizacije</li> <li><a href=https://www.linkedin.com/in/sabina-tamse-copywriter/ >Sabina Tamše Kozovinc</a> - tekstopisje</li> <li><a href=https://twitter.com/ZaplotnikZiga>Žiga Zaplotnik</a> - modeliranje</li> </ul> ';i.exports=o}}]);
